// import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className=" flex items-center justify-center bg-green-900">
     <div className=" w-full h-full sm:w-[60%] sm:h-[60%] p-5 rounded-lg bg-zinc-700 shadow-xl">
      <div className="w-full ">
        <div className="text-lg text-neutral-300 font-medium hover:text-green-700">Home</div>
        <div className="text-lg text-neutral-300 font-medium hover:text-green-700">About</div>
        <div className="text-lg text-neutral-300 font-medium hover:text-green-700"></div>
      </div>
     </div>
    </div>
  );
}

export default App;
